import {Form, Row, Col} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div style={{ width: "70%" }}>
    <Form.Group>
      <Row>
      <Form.Label column="lg" lg={2}>
      Large Text
    </Form.Label>
    <Col>
      <Form.Control size="lg" type="text" placeholder="Large text" />
    </Col>
      </Row>
</Form.Group>
</div>
  );
}

export default App;
